    <script>
        $(document).ready(function () {
            var specials = [94, 95, 96, 126];
            var chars = ['e', 'o', 'a', 'u'];
            $(".js-search").keypress(function (e) {
                var $val = $(this).val();
                var $last = $val.slice(-1);
                if ($last.length > 0 && jQuery.inArray($last.toLowerCase(), chars) >= 0 && jQuery.inArray(e.which, specials) >= 0) {
                    e.preventDefault();
                }
            });
        });
